import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    const feedback = {
        title: 'Give feedback',
        votes: {
            good: 0,
            neutral: 0,
            bad: 0
        }
    }

    return (
        <div>
            <Header {...feedback}/>
            <Buttons/>
            /* <Table {...feedback}/> */
        </div>
    )
}

const Header = (props) => {
    return (
        <h1>{props.feedback.title}</h1>
    )
}

const Buttons = (props) => {
    return (
        <>
            <button>Vote up</button>
            <button>Vote neutral</button>
            <button>Vote down</button>
        </>
    )
}
